import React from 'react'

const Header = ({text,bgcolor,clr,pad,size}) => {
  return (
    <div>
        <h2 style = {{backgroundColor:bgcolor,color:clr,padding:pad,fontSize:size}}>{text}</h2>
    </div>
  )
}

Header.defaultProps = {
    text: 'Material UI',
    pad: '40px 0 40px 0',
    bgcolor: 'red',
    clr: 'white',
    size: '0px'
}

export default Header
